import RecipeCardContainer from "../containers/RecipeCardContainer";
import SearchForm from "./SearchForm";
import NewRecipeForm from "./NewRecipeForm";

export default class ChefsDashboard extends Component {
  render() {
    return (
      <div>
        <SearchForm />
        <NewRecipeForm />
        <RecipeCardContainer />
      </div>
    );
  }
}
